iption_crossDomain2_custom_cross_domain:"{0}2{1} - Copiez le code Javascript suivant.",bo_sites_installation_copyStep_description_crossDomain3:"{0}3{1} - Collez ce code juste après la balise <head> dans le code source de vos pages web avant tous les autres scripts. Retrouvez les instructions juste {2}ici{3}.",bo_sites_installation_copyStep_description_crossDomain3_tagManager:"{0}3{1} - Collez ce code dans l’interface de votre Tag Manager.",bo_sites_installation_copyStep_description_crossDomain4:"{0}4{1} - Vous devez mettre en place la synchronisation entre le fichier hebergé sur vos serveurs / CDN et le fichier original généré par la plateforme Kameleoon. Veuillez-suivre les instructions {2}suivantes{3}.",bo_sites_installation_copyStep_description_crossDomain_urlNotDefined:"{0}1{1} - Vous devez télécharger le fichier statique Kameleoon permettant le cross tracking ci-dessous (qui contient les informations liées à votre site) et l'héberger sur votre site (domaine principal), en créant une nouvelle page et en utilisant une URL absolue.",bo_sites_installation_copyStep_description_crossDomain_urlDefined:"{0}1{1} - Vous devez télécharger le fichier statique Kameleoon permettant le cross tracking ci-dessous (qui contient les informations liées à votre site) et l'héberger sur l’URL que vous avez définie à l’étape précédente :",bo_sites_installation_configuredStep_title_installed:"Kameleoon est bien détecté sur votre site web.",bo_sites_installation_configuredStep_title_errorDetection:"Kameleoon n'est pas détecté sur votre site web.",bo_sites_installation_configuredStep_title_errorTechnical:"La configuration technique de votre site web ne nous permet pas de détecter le script.",bo_sites_installation_configuredStep_sublabel_type:"Implementation options:",bo_sites_installation_configuredStep_sublabel_tag:"Installation tag:",bo_configuration_sites_settings_installation_successStep_and:"et",bo_sites_settings_installation_input_wideDomainSupport_label:"Cross domain tracking",bo_